    type IOperation<'a> = abstract Exec : 'a -> 'a -> int

    exception ValidationException of lhs:obj * rhs:obj * expected:obj * received:obj

    let make_result_set<'a,'b when 'b : equality> (f:IOperation<'a>) (items:array<'a>) (validation_set:option<array<int>>)=
        let results = Array.zeroCreate (items.Length*items.Length)
        for i = 0 to items.Length-1 do
            for j = 0 to items.Length-1 do
                let index = i * items.Length + j
                let lhs = items.[i] 
                let rhs = items.[j]
                let result = f.Exec lhs rhs

                validation_set
                |> Option.iter (fun validation_set ->
                    let expected = validation_set.[index]
                    if expected <> result then
                        raise (ValidationException (box lhs, box rhs, expected, result)))

                results.[index] <- result
        results

    let toint b = if b then 1 else 0

    type EqualityOperations<'a when 'a : equality>() =
        member inline __.equals     = { new IOperation<'a> with member __.Exec lhs rhs = toint (HashIdentity.Structural.Equals(lhs,rhs)) }
        member inline __.equal      = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs = rhs) }
        member inline __.not_equal  = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs <> rhs) }

    type ComparisonOperations<'a when 'a : comparison>() =
        member inline __.equals             = { new IOperation<'a> with member __.Exec lhs rhs = toint (HashIdentity.Structural.Equals(lhs,rhs)) }
        member inline __.equal              = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs = rhs) }
        member inline __.not_equal          = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs <> rhs) }
        member inline __.compare            = { new IOperation<'a> with member __.Exec lhs rhs = ComparisonIdentity.Structural.Compare(lhs,rhs) }
        member inline __.less_than          = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs < rhs) }
        member inline __.less_or_equal      = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs <= rhs) }
        member inline __.greater_than       = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs > rhs) }
        member inline __.greater_or_equal   = { new IOperation<'a> with member __.Exec lhs rhs = toint (lhs >= rhs) }

    type NoninlinableEqualityOperations<'a when 'a : equality>() =
        let operations = 
            let underlyingType = typedefof<EqualityOperations<_>>.MakeGenericType [| typeof<'a> |]
            match System.Activator.CreateInstance underlyingType with
            | :? EqualityOperations<'a> as operations -> operations
            | _ -> failwith ""

        member __.equals = operations.equals
        member __.equal      = operations.equal
        member __.not_equal     = operations.not_equal

    type NoninlinableComparisonOperations<'a when 'a : comparison>() =
        let operations = 
            let underlyingType = typedefof<ComparisonOperations<_>>.MakeGenericType [| typeof<'a> |]
            match System.Activator.CreateInstance underlyingType with
            | :? ComparisonOperations<'a> as operations -> operations
            | _ -> failwith ""

        member __.equals           = operations.equals
        member __.equal            = operations.equal
        member __.not_equal        = operations.not_equal
        member __.compare          = operations.compare
        member __.less_than        = operations.less_than
        member __.less_or_equal    = operations.less_or_equal
        member __.greater_than     = operations.greater_than
        member __.greater_or_equal = operations.greater_or_equal

    type E<'a when 'a : equality>() =
        static let inlinable    = EqualityOperations<'a> ()
        static let noninlinable = NoninlinableEqualityOperations<'a> ()

        static member I = inlinable
        static member N = noninlinable

    type C<'a when 'a : comparison>() =
        static let inlinable    = ComparisonOperations<'a> ()
        static let noninlinable = NoninlinableComparisonOperations<'a> ()
        
        static member I = inlinable
        static member N = noninlinable

