    let create<'a,'b when 'b : equality> name operation (f:IOperation<'a>) (items:array<'a>) =
        printf """ [<Test>]
 member __.``%s %s``() =
  validate (%s) %s """ name operation name operation

        make_result_set f items None
        |> Seq.iteri (fun n result ->
            if n = 0 
                then printf "[|"
                else printf ";"
            if n % 40 = 0 then printf "\n   "
            printf "%d" result)
        printfn "\n  |]\n"

